// contracts/SeventFinanceV2
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./ISeventFinance.sol";
import "./Proxy.sol";

contract SeventFinanceV2 is Proxy, ERC20, Ownable, Pausable {
    using SafeMath for uint256;
    uint256 public constant INITIAL_SUPPLY = 400000000 * 10**18;
    uint256 public immutable MINT_AMOUNT = 100 * 10**18;

    // Vesting variables
    address public vestingBeneficiary;
    uint256 public vestingStart;
    uint256 public vestingDuration;
    uint256 public vestingCliff;

    // Airdrop variables
    address public instagramAccount;
    address public accountX;

    event TokenBurned(address indexed burner, uint256 amount);
    event TokenMinted(address indexed minter, uint256 amount);
    event VestingSetup(address indexed beneficiary, uint256 start, uint256 cliff, uint256 duration);
    event AirdropSet(address indexed instagramAccount, address indexed accountX);

    constructor(
        address _implementation,
        address _vestingBeneficiary,
        uint256 _vestingStart,
        uint256 _vestingCliff,
        uint256 _vestingDuration,
        address _instagramAccount,
        address _accountX
    ) Proxy(_implementation) ERC20("SeventFinanceV2", "Svt") {
        _mint(msg.sender, INITIAL_SUPPLY);

        // Set up vesting
        vestingBeneficiary = _vestingBeneficiary;
        vestingStart = _vestingStart;
        vestingCliff = _vestingCliff;
        vestingDuration = _vestingDuration;

        // Set up airdrop
        instagramAccount = _instagramAccount;
        accountX = _accountX;
    }

    function transfer(address recipient, uint256 amount) public virtual override whenNotPaused returns (bool) {
        require(amount <= balanceOf(msg.sender), "insufficient balance");

        // Vesting check
        if (msg.sender == vestingBeneficiary) {
            require(block.timestamp >= vestingStart, "Vesting has not started yet");
            uint256 vestedAmount = getVestedAmount();
            require(amount <= vestedAmount, "Insufficient vested balance");
        }

        _transfer(msg.sender, recipient, amount);
        return super.transfer(recipient, amount);
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual whenNotPaused override returns (bool) {
        require(_msgSender() == sender || amount <= allowance(sender, _msgSender()), "ERC20: transfer amount exceeds allowance");

        // Vesting check
        if (sender == vestingBeneficiary) {
            require(block.timestamp >= vestingStart, "Vesting has not started yet");
            uint256 vestedAmount = getVestedAmount();
            require(amount <= vestedAmount, "Insufficient vested balance");
        }

        _transfer(sender, recipient, amount);
        if (_msgSender() != sender && allowance(sender, _msgSender()) != type(uint256).max) {
            _approve(sender, _msgSender(), allowance(sender, _msgSender()) - amount);
        }
        return super.transferFrom(sender, recipient, amount);
    }

    function burn(uint256 amount) public {
        _burn(msg.sender, amount);
        emit TokenBurned(msg.sender, amount);
    }

    function mint(uint256 amount) public onlyOwner {
        _mint(msg.sender, amount);
        emit TokenMinted(msg.sender, amount);
    }

    function setupVesting(address beneficiary, uint256 start, uint256 cliff, uint256 duration) public onlyOwner {
        require(beneficiary != address(0), "Invalid beneficiary address");
        require(start >= block.timestamp, "Start time should be in the future");
        require(cliff >= start, "Cliff time should be greater than or equal to start time");

        vestingBeneficiary = beneficiary;
        vestingStart = start;
        vestingCliff = cliff;
        vestingDuration = duration;

        emit VestingSetup(beneficiary, start, cliff, duration);
    }

    function setAirdrop(address _instagramAccount, address _accountX) public onlyOwner {
        require(_instagramAccount != address(0) && _accountX != address(0), "Invalid airdrop addresses");

        instagramAccount = _instagramAccount;
        accountX = _accountX;

        emit AirdropSet(_instagramAccount, _accountX);
    }

    function getVestedAmount() public view returns (uint256) {
        if (block.timestamp < vestingCliff) {
            return 0;
        } else if (block.timestamp >= vestingStart.add(vestingDuration)) {
            return balanceOf(vestingBeneficiary);
        } else {
            return balanceOf(vestingBeneficiary).mul(block.timestamp.sub(vestingCliff)).div(vestingDuration);
        }
    }
}
